Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    import spark.implicits._

    // Load onsite attributed data
    val onsiteData: JavaRDD[(String, Long)] = spark.sparkContext.parallelize(List(
      ("query1", 1614384000),
      ("query2", 1614384001),
      ("query1", 1614384002),
      ("query3", 1614384003),
      ("query2", 1614384004),
      ("query1", 1614384005),
      ("query4", 1614384006),
      ("query2", 1614384007),
      ("query3", 1614384008),
      ("query1", 1614384009)
    )).map(x => (x._1, x._2)).toJavaRDD

    // Load top frequent queries
    val topQueries: List[String] = List("query1", "query2", "query3")

    // Broadcast top frequent queries
    val broadcastTopQueries: Broadcast[List[String]] = spark.sparkContext.broadcast(topQueries)

    // Define cache with 12 hours expiration time
    val cache = mutable.Map[String, Long]()

    // Calculate hit rate
    val hitRate = onsiteData.mapPartitions(iter => {
      val cachedQueries = ListBuffer[String]()
      iter.map { case (query, timestamp) =>
        if (broadcastTopQueries.value.contains(query)) {
          if (!cache.contains(query) || cache(query) < timestamp - 12 * 60 * 60) {
            // Cache miss, add query to cache
            cache.put(query, timestamp + 12 * 60 * 60)
            (query, false)
          } else {
            // Cache hit
            cachedQueries.append(query)
            (query, true)
          }
        } else {
          (query, false)
        }
      }.toList
    }).reduce((a, b) => (a._1 ++ b._1, a._2 ++ b._2))

    // Calculate hit rate
    val totalQueries = hitRate._1.length
    val cacheHits = hitRate._2.count(_ == true)
    val hitRateValue = cacheHits.toDouble / totalQueries.toDouble

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries. It then broadcasts the top frequent queries to all nodes in the cluster. The job then defines a cache with a 12-hour expiration time.

The job then calculates the hit rate by iterating over the onsite attributed data and checking if each query is in the top frequent queries. If the query is in the top frequent queries and is not in the cache or has expired, it is a cache miss and the query is added to the cache. If the query is in the top frequent queries and is in the cache, it is a cache hit.

Finally, the job calculates the hit rate by dividing the number of cache hits by the total number of queries.

